import React from 'react';
import './SearchResultsPage.css'
const SearchResultsPage = () => {
  // return (
  //   <>
  //     <div className="companyTitle">
  //       <p>Test<span>ING</span></p>
  //     </div>
  //     {/* <!-- This is a comment -->
  //     <div  className="searchBar">
  //       <input type="text" placeholder="Find your latest deal today. &#x1F50E;"></input>
  //     </div> */}
  //     <p>WIP*</p>
  //   </>
  // )
  return (
    <table>
      <thead>
        <tr>
          <th>Image</th>
          <th>Product</th>
          <th>Quantity</th>
          <th>Price</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td><img src="path_to_image.jpg" alt="product" width="50" /></td>
          <td>Sample Product</td>
          <td>5</td>
          <td>$10.00</td>
          <td><button>Add to Cart</button></td>
        </tr>
        {/* ... Add more rows as needed ... */}
      </tbody>
    </table>
  );
  const products = [
    {
      imgSrc: "path_to_image1.jpg",
      name: "Product 1",
      quantity: 5,
      price: "$10.00"
    },
    // ... more products
  ];

  return (
    <table>
      {/* ... (thead code) ... */}
      <tbody>
        {products.map((product, index) => (
          <tr key={index}>
            <td><img src={product.imgSrc} alt={product.name} width="50" /></td>
            <td>{product.name}</td>
            <td>{product.quantity}</td>
            <td>{product.price}</td>
            <td><button>Add to Cart</button></td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default SearchResultsPage;
